asid char(38);
begin
declare cursor closer is
select the_sessionid id from the_session where lastaccess < (sysdate()-0.008) and closed =0;
closer_rec  closer%ROWTYPE;
begin
 --open closer;
 for closer_rec in closer loop
   Logout (closer_rec.id);
 end loop;
close closer;
end;
end;

 
