aparent varchar2(255);
aprev varchar2(255);
atmpID  char(38);
atmpRowID  char(38);
astr varchar2(4000);
existsCnt integer;
begin
select count(*) into existsCnt from the_session where the_sessionid=acursession and closed=0 ;
 -- checking session  --
if  existsCnt =0
  then
    raise_application_error(-20000,'Session expired');

    return;
  end if;

aparent :=athe_table;
atmpID := athe_ROWID;

<<again>>

aprev := aparent;
begin 

select thevalue into aparent from sysoptions where optiontype = 'PARENT' and  name=aprev;
exception
when others then
aparent := null;
end;
if aparent is null then
    astr := 'select InstanceID from ' || aprev || ' where ' || aprev || 'id=:1';
    begin
        execute immediate astr into atmpRowID using atmpid;
        athe_InstanceID:=atmpRowID	    	;
    exception when others then
        athe_InstanceID:=null;
    end;
    
else
    astr :='select ParentStructRowID from ' || aprev || ' where ' || aprev || 'id=:1';
    begin
        execute immediate astr into atmpRowID using atmpid;
        atmpID := atmpROWID;
            exception when others then
              atmpID := null;
    end;
    goto again;
end if;
end
;

 RETURNS uuid AS
$BODY$

declare
aparent varchar(255);
aprev varchar(255);
atmpID  uuid;
atmpRowID  uuid;
athe_InstanceID uuid;
astr varchar(4000);
existsCnt integer;
begin
select count(*) into existsCnt from the_session where the_sessionid=acursession and closed=0 ;
 -- checking session  --
if  existsCnt =0
  then
    perform raise_application_error(-20000,'Session expired');

    return null;
  end if;

aparent :=athe_table;
atmpID := athe_ROWID;

loop

aprev := aparent;
begin 

aparent := null;
select thevalue into aparent from sysoptions where optiontype = 'PARENT' and  name=aprev;

end;
if aparent is null then
    astr := 'select InstanceID  from ' || aprev || ' where ' || aprev || 'id=$1';
    begin
        athe_InstanceID:=null;
        execute astr into atmpRowID using atmpid; 
        athe_InstanceID:=atmpRowID ;
    end;
    return athe_InstanceID;
else
    astr :='select ParentStructRowID from ' || aprev || ' where ' || aprev || 'id=$1';
    begin
	atmpID := null;
        execute astr into atmpRowID using atmpid;
        atmpID := atmpROWID;
    end;
 end if;
end loop;
end
;
$BODY$
